import React from "react";
import "./App.css";

import Wrap from "./components/Wrap";
import Input from "./components/Input";
import ButtonBox from "./components/ButtonBox";

function App() {
  return (
    <Wrap>
      <Input />
      <ButtonBox></ButtonBox>
    </Wrap>
  );
}

export default App;
